    List<string> GetPassingYears(string options)
    {
        List<string> li = new List<string>();
        if (options == "Yes")
        {
            li.Add("Appearing");
        }

        for (int i = DateTime.Now.Year; i >= 2010; i--)
        {
            li.Add(i.ToString());
        }
        return li;
    }

